import React from 'react'
import './Post.css'

// ICON
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';


const Post = () => {
  return (
    <div className='post'>
      <div className="post__top">
        <div className="post__top__left"></div>
        <div className="post__top__right">
            <MoreHorizIcon />
        </div>
      </div>
    </div>
  )
}

export default Post
